import React, {Component} from "react";


class ProfileMain extends Component {
    constructor(props) {
        super(props);
    }


    render() {
        return (
            <React.Fragment>
                <div className="backgroundContainer position-fixed mt-4">
                    <div className="row text-center justify-content-end">
                        <div
                            className="col-md-8 col-lg-5 mh-75 bg-light mt-5 p-4 border border-secondary shadow-lg rounded-bottom">
                            <div className="row">
                                <div className="col-8 text-left">
                                    <h4>Marius</h4>
                                </div>
                                <div className="col-4">
                                    <button onClick={this.props.close}
                                            className="btn btn-light material-icons float-right">
                                        close
                                    </button>
                                </div>
                            </div>
                            <div className="container">
                                <div className="row">
                                    
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}

export default ProfileMain;
